import 'package:json_annotation/json_annotation.dart';part 'user.g.dart';@JsonSerializable()class User {  int? id;  @JsonKey(name: 'created_at')  String? createdAt;  String? phone;  String? ava;  String? name;  @JsonKey(name: 'about_me')  String? about;  @JsonKey(name: 'data_complete')  bool? dataComplete;  @JsonKey(name: 'terms_agree')  bool? termsAgree;  int? gender;  @JsonKey(name: 'birth_date')  String? birthDate;  List<String>? hobbies;  int? height;  int? weight;  @JsonKey(name: 'hair_color')  String? hairColor;  @JsonKey(name: 'eye_color')  String? eyeColor;  List<String>? photos;  @JsonKey(name: 'blur_photos')  bool? blurPhotos;  @JsonKey(name: 'family_status')  int? familyStatus;  @JsonKey(name: 'city_id')  int? cityId;  @JsonKey(name: 'marriage_period')  String? marriagePeriod;  set setTermsAgree(bool val) => termsAgree = val;  User({    this.id,    this.name,    this.phone,    this.createdAt,    this.dataComplete,    this.termsAgree,    this.height,    this.gender,    this.ava,    this.birthDate,    this.blurPhotos,    this.eyeColor,    this.hairColor,    this.hobbies,    this.photos,    this.weight,    this.about,    this.familyStatus,    this.cityId,    this.marriagePeriod,  });  User copyWith({    int? id,    String? createdAt,    String? phone,    String? ava,    String? name,    bool? dataComplete,    bool? termsAgree,    int? gender,    String? birthDate,    List<String>? hobbies,    int? height,    int? weight,    String? hairColor,    String? eyeColor,    List<String>? photos,    bool? blurPhotos,    int? familyStatus,    int? cityId,    String? about,    String? marriagePeriod,  }) {    return User(      id: id ?? this.id,      createdAt: createdAt ?? this.createdAt,      phone: phone ?? this.phone,      ava: ava ?? this.ava,      name: name ?? this.name,      dataComplete: dataComplete ?? this.dataComplete,      termsAgree: termsAgree ?? this.termsAgree,      gender: gender ?? this.gender,      birthDate: birthDate ?? this.birthDate,      hobbies: hobbies ?? this.hobbies,      height: height ?? this.height,      weight: weight ?? this.weight,      hairColor: hairColor ?? this.hairColor,      eyeColor: eyeColor ?? this.eyeColor,      photos: photos ?? this.photos,      blurPhotos: blurPhotos ?? this.blurPhotos,      about: about ?? this.about,      familyStatus: familyStatus ?? this.familyStatus,      cityId: cityId ?? this.cityId,      marriagePeriod: marriagePeriod ?? this.marriagePeriod,    );  }  factory User.fromJson(Map<String, dynamic> json) => _$UserFromJson(json);  Map<String, dynamic> toJson() => _$UserToJson(this);}